import {Component} from '@angular/core';
import {FormControl, FormGroup}
  from '@angular/forms';

export enum Menu {
  BOOKS = 'BOOKS',
  USERS = 'USERS',
  BORROWINGS = 'BORROWINGS'
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']

})


export class AppComponent {
  cislo = "0";
  changeChecks(cislo: String): void {
    let num = Number(cislo);
    let bin = "";

    while (num != 0) {
      if (num % 2 == 1) {
        bin = "1" + bin;
      } else {
        bin = "0" + bin;
      }
      num = Math.floor(num / 2);
    }
    for (let a = 0 + bin.length; a < 8; a++) {
      bin = "0" + bin;
    }
    let b = [];
    for (let a = 0; a < bin.length; a++) {
      b[a] = bin[a];
    }
    for (let i = 0; i <= 7; i++) {
      let checkbox = document.getElementById(
        i.toString()
      ) as HTMLInputElement | null;

      if (checkbox != null) {
        if (b[i] == '1') {
          checkbox.checked = true;
        } else {
          checkbox.checked = false;
        }
      }
    }
  }

  changeInputNumber(): void {
    let dec = "";
    for (let i = 0; i <= 7; i++) {
      let checkbox = document.getElementById(
        i.toString()
      ) as HTMLInputElement | null;

      if (checkbox != null) {
        if (checkbox.checked == true) {
          dec = dec.concat("1")
        } else {
          dec = dec.concat("0")
        }
      }
    }
    let x = parseInt(dec, 2);
    this.cislo = x.toString();
  }


  menu = Menu;
  actualMenu: Menu = Menu.USERS;
  form: FormGroup;
  persons: Array<any> = [];

  constructor() {
    this.form = new FormGroup({
      name: new FormControl(),
      surname: new FormControl()
    })
  }
  changeMenu(menuItem: Menu): void {
    this.actualMenu = menuItem;
  }

  savePerson(): void {
    this.persons.push(
      this.form.value);
    this.form.reset();
  }

}









<div class="menu">
  <button (click)="changeMenu(menu.USERS)">POUŽÍVATELIA</button>
  <button (click)="changeMenu(menu.BOOKS)">KNIHY</button>
  <button (click)="changeMenu(menu.BORROWINGS)">VÝPOŽIČKY</button>
</div>

<ng-container *ngIf="actualMenu === menu.USERS">
  <h3>POUŽÍVATELIA</h3>
  <form [formGroup]="form" (submit)="savePerson()">
  <label>Meno:
    <input type="text"
           formControlName="name" />
  </label>
  <label>Priezvisko:
    <input type="text"
           formControlName="surname" />
  </label>
  <button type="button" (click) = "savePerson()">Ulozit</button>
</form>

<table *ngIf="persons.length">
  <tr>
    <th>Meno</th>
    <th>Priezvisko</th>
  </tr>
  <tr *ngFor="let person of persons">
    <td>{{ person.name }}</td>
    <td>{{ person.surname }}</td>
  </tr>
</table>
</ng-container>
<ng-container *ngIf="actualMenu === menu.BOOKS">
  <h3>KNIHY</h3>
</ng-container>

<ng-container *ngIf="actualMenu === menu.BORROWINGS">
  <h3>VÝPOŽIČKY</h3>
</ng-container>

<ng-container *ngIf="actualMenu === menu.BORROWINGS">
  <h3>Zanre</h3>
</ng-container>
